import React from "react";
import { Routes, Route, useNavigate } from "react-router-dom";
import BlogFeeds from "./components/blog/BlogFeeds";
import ThankYou from "./components/thankYou/ThankYou";
import NavBar from "./components/navBar/NavBar";
import { lazy, Suspense } from "react";
import { ErrorBoundary } from "react-error-boundary";
import Home from "./components/homePage/Home";
import NotFound from "./components/notFound/NotFound";
import ErrorFallback from "./components/error/ErrorFallback";
import Footer from "./components/footer/Footer";
import Newsletter from "./components/newsLetter/Newsletter";
import SubThankYou from "./components/newsLetter/SubThankYou";

const HireMe = lazy(() => import("./components/hireMe/HireMe"));
const BlogDetails = lazy(() => import("./components/blog/BlogDetails"));
const AboutMe = lazy(() => import("./components/aboutMe/AboutMe"));

function App() {
  const navigate = useNavigate();

  return (
    <>
      <NavBar />
      <Routes>
        <Route
          exact
          path="/articles"
          element={
            <ErrorBoundary
              onReset={() => navigate("/")}
              fallbackRender={({ error, resetErrorBoundary }) => (
                <ErrorFallback
                  error={error}
                  resetErrorBoundary={resetErrorBoundary}
                />
              )}
            >
              <Suspense>
                <BlogFeeds />
              </Suspense>
            </ErrorBoundary>
          }
        />

        <Route
          exact
          path="/newsletter"
          element={
            <ErrorBoundary
              onReset={() => navigate("/")}
              fallbackRender={({ error, resetErrorBoundary }) => (
                <ErrorFallback
                  error={error}
                  resetErrorBoundary={resetErrorBoundary}
                />
              )}
            >
              <Suspense>
                <Newsletter />
              </Suspense>
            </ErrorBoundary>
          }
        />

        <Route
          exact
          path="/"
          element={
            <ErrorBoundary
              onReset={() => navigate("/")}
              fallbackRender={({ error, resetErrorBoundary }) => (
                <ErrorFallback
                  error={error}
                  resetErrorBoundary={resetErrorBoundary}
                />
              )}
            >
              <Suspense>
                <>
                  <Home />
                  {/* <Footer /> */}
                </>
              </Suspense>
            </ErrorBoundary>
          }
        />
        <Route
          exact
          path="/404"
          element={
            <ErrorBoundary
              onReset={() => navigate("/")}
              fallbackRender={({ error, resetErrorBoundary }) => (
                <ErrorFallback
                  error={error}
                  resetErrorBoundary={resetErrorBoundary}
                />
              )}
            >
              <Suspense>
                <>
                  <NotFound />
                  {/* <Footer /> */}
                </>
              </Suspense>
            </ErrorBoundary>
          }
        />
        <Route
          exact
          // path="/articles/:slug"
          path="/articles/:slug"
          element={
            <ErrorBoundary
              onReset={() => navigate("/")}
              fallbackRender={({ error, resetErrorBoundary }) => (
                <ErrorFallback
                  error={error}
                  resetErrorBoundary={resetErrorBoundary}
                />
              )}
            >
              <Suspense>
                <>
                  <BlogDetails />
                  {/* <Footer /> */}
                </>
              </Suspense>
            </ErrorBoundary>
          }
        />
        <Route
          exact
          path="/me"
          element={
            <ErrorBoundary
              onReset={() => navigate("/")}
              fallbackRender={({ error, resetErrorBoundary }) => (
                <ErrorFallback
                  error={error}
                  resetErrorBoundary={resetErrorBoundary}
                />
              )}
            >
              <Suspense>
                <>
                  <AboutMe />
                  {/* <Footer /> */}
                </>
              </Suspense>
            </ErrorBoundary>
          }
        />
        <Route
          exact
          path="/hire-me"
          element={
            <ErrorBoundary
              onReset={() => navigate("/")}
              fallbackRender={({ error, resetErrorBoundary }) => (
                <ErrorFallback
                  error={error}
                  resetErrorBoundary={resetErrorBoundary}
                />
              )}
            >
              <Suspense>
                <>
                  <HireMe />
                  {/* <Footer /> */}
                </>
              </Suspense>
            </ErrorBoundary>
          }
        />
        <Route
          exact
          path="/thank-you"
          element={
            <ErrorBoundary
              onReset={() => navigate("/")}
              fallbackRender={({ error, resetErrorBoundary }) => (
                <ErrorFallback
                  error={error}
                  resetErrorBoundary={resetErrorBoundary}
                />
              )}
            >
              <Suspense>
                <>
                  <ThankYou />
                  {/* <Footer /> */}
                </>
              </Suspense>
            </ErrorBoundary>
          }
        />
        <Route
          exact
          path="/thank-you-for-subscribing"
          element={
            <ErrorBoundary
              onReset={() => navigate("/")}
              fallbackRender={({ error, resetErrorBoundary }) => (
                <ErrorFallback
                  error={error}
                  resetErrorBoundary={resetErrorBoundary}
                />
              )}
            >
              <Suspense>
                <>
                  <SubThankYou />
                </>
              </Suspense>
            </ErrorBoundary>
          }
        />
      </Routes>
      <Footer />
    </>
  );
}

export default App;
